import React from 'react';
import { Container } from 'react-bootstrap';

const About = () => {
    return (
        <div>
            <Container>
                <div className="text-center pt-5 pb-5">
                    <h3>About Us</h3>

                    <p>Though exploration is often associated with places, at its very heart, 
                    it’s about the people. For nearly 70 years, the person-to-person experience has 
                    been at the very core of Liberty Travel’s mission. It’s what we’ve always done and 
                    it’s what we do now. Real people helping real people. Beside you every step of the way.
                    </p>

                </div>
            </Container>
        </div>
    );
};

export default About;
